 async getBody(url){
    const res = await fetch(url);
    if(!res.ok){
      throw new Error(res.status)
    }
  return await res.json()


  };
 getPeople(){
   this.getBody("https://swapi.co/api/people/")
 };
 getStarShips(){
   const res = this.getBody("https://swapi.co/api/starships/");
      return res.results
 };
 getPlanets(){
   this.getBody("https://swapi.co/api/planets/")
 }
};


